import React,{useState,useEffect} from 'react'

function UseEffects() {
    const [count, setcount] = useState(0);
    useEffect(() => {
        document.title
    }, [])
    return (
        <div>
            <h1>Hello World !</h1>
            <h2>New message <span>{count}</span></h2>
            <button onClick={()=>setcount(count+1)}>Raise</button>
        </div>
    )
}

export default UseEffects
